    }
  }

  render() {
    return (
      <>
        <CaseVacanzaFilter casaVacanza={caseVacanza} />
        <div className="ListaProp">
        <CaseVacanzaList caseVacanza={sortedCaseVacanza} />
        </div>
      </>
    );
